import React, { Fragment} from 'react';

const Formulario = () => {
    return ( 
        <Fragment>
            <h1>Crear Cita</h1>
            <form>
                <label>Nombre de la mascota</label>
                <input 
                    type="text"
                    name="mascota"
                    className="u-full-width"
                    placeholder="Nombre Mascota"
                />
            </form>
        </Fragment>
     );
}

export default Formulario;
